import React from 'react';

const CardBlock = (props) => {
    
    const renderCards = () => (
        props.list ?
            props.list.map((card, i) => (
                <div>
                    'CARD'
                </div>
            ))  
        :null
    )
    
    return (
        <div className="card_block">
            <div className="container">
                {
                    props.title ?
                        <div className="title">
                            {props.title}
                        </div>
                    :null
                }
                <div style={{
                    display:'flex',
                    flexWrap: 'wrap'
                }}>
                    { renderCards(props.list) }
                </div>
            </div>
        </div>
    );
};

export default CardBlock;
